import numpy as np
import matplotlib.pyplot as plt
from scipy.integrate import quad

def plot(tempo, funcao):
  plt.plot(tempo, funcao(tempo))
  plt.xlabel('t')
  plt.ylabel('y')
  plt.title('Curva exponencial decrescente')
  plt.show()

