# define os limites de t
t_inicio = 0
t_fim = 20

# define o tamanho do passo
dt = 0.01

# cria o array de valores de t com o passo definido
t = np.arange(t_inicio, t_fim + dt, dt)

# calcula os valores correspondentes da função exponencial
y = 2 * np.exp(-t / 2)

# calcula a energia da curva exponencial
energia = np.trapz(y**2, t)

# imprime o valor da energia
print("Energia = {:.2f}".format(energia))

# plota o gráfico da curva exponencial
plt.plot(t, y)
plt.xlabel('t')
plt.ylabel('y')
plt.title('Curva exponencial decrescente')
plt.show()

def integrate(funcao, tempoInicio, tempoFim, passos):
  somatoria = 0
  tempo = tempoInicio
  while (tempo <= tempoFim):
    somatoria += funcao(tempo)*tempo
    tempo += passos
  return somatoria


def funcao1(tempo):
  return np.sin(tempo)


def funcao2(tempo):
  return np.sin(2*tempo)


def funcao3(tempo):
  return np.sin(tempo-1)


def funcao4(tempo):
  return np.sin(3*tempo+5)


tempoInicio = -2
passos = 0.1
tempoFim = 5 + passos
tempo = np.arange(tempoInicio,tempoFim, passos)

print(f"\n{integrate(funcao1, tempoInicio, tempoFim, passos)}")
plot(tempo, funcao1)

print(f"\n{integrate(funcao2, tempoInicio, tempoFim, passos)}")
plot(tempo, funcao2)

print(f"\n{integrate(funcao3, tempoInicio, tempoFim, passos)}")
plot(tempo, funcao3)

print(f"\n{integrate(funcao4, tempoInicio, tempoFim, passos)}")
plot(tempo, funcao4)

